import React, { useState, useEffect } from "react";

const Dashboard = () => {
  const [keywords, setKeywords] = useState([]);

  useEffect(() => {
    fetch("https://localhost:7147/api/Keywords/GetKeywords")
      .then((response) => response.json())
      .then((data) => setKeywords(data))
      .catch((error) => console.error("Error fetching data:", error));
  }, []);

  const totalKeywords = keywords.length;
  const totalVolume = keywords.reduce((acc, keyword) => acc + keyword.SearchVolume, 0);

  return (
    <div className="p-6 space-y-6">
      <div className="bg-white p-6 rounded-lg shadow-lg">
        <h2 className="text-2xl font-semibold">Resumen</h2>
        <div className="mt-4 text-xl">
          <p>Total de Keywords: {totalKeywords}</p>
          <p>Total de Volumen de Búsqueda: {totalVolume}</p>
        </div>
      </div>

      <div className="overflow-x-auto bg-white p-6 rounded-lg shadow-lg">
        <h3 className="text-xl font-semibold">Keywords</h3>
        <table className="min-w-full mt-4">
          <thead>
            <tr>
              <th className="px-4 py-2 text-left">Keyword</th>
              <th className="px-4 py-2 text-left">Volumen de Búsqueda</th>
            </tr>
          </thead>
          <tbody>
            {keywords.map((keyword, index) => (
              <tr key={index} className="border-t">
                <td className="px-4 py-2">{keyword.Name}</td>
                <td className="px-4 py-2">{keyword.SearchVolume}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Dashboard;
